def get_recommendation(user_id : int, emotions : list = None, start_idx = 0, count = 10, order = 'score') -> list:
    """
    user_id(int):  id
    emotions(<str>list):  
        - 
            - ['love']  ['anger', 'fear']
            - 'love' 
    start_idx(int):   
    count(int):  
    order(str):  
        - 'score', 'confidence', 'average_rating', 'ratings_count'
    """
    recommend_data = pandas.read_json(get_jsonstring(), orient='table')
    if emotions:
        filtered_recommend_data = recommend_data[recommend_data['emotions'].str.contains('|'.join(emotions), na=True)]
    else:
        filtered_recommend_data = recommend_data
    
    filtered_recommend_data.sort_values(order, ascending=False, inplace=True)
    recommend_list = recommend_data[recommend_data['user_id']==user_id].reset_index(drop=True).iloc[start_idx:start_idx+count + 1, 1].values.tolist()
    return recommend_list

def recommend(request):
    """Responds to any HTTP request.
    Args:
        request (flask.Request): HTTP request object.
    Returns:
        The response text or any set of values that can be turned into a
        Response object using
        `make_response <http://flask.pocoo.org/docs/1.0/api/#flask.Flask.make_response>`.
    """
    uid = 202169
    start_num = 0
    count = 30
    order = 'average_rating'
    emotion_list = []

    request_json = request.get_json()
    if request_json and 'test_table' in request_json:
        return str(pandas.read_json(get_jsonstring(), orient='table').to_string())
    
    if request_json:
        if 'uid' in request_json:
            uid = int(request_json['uid'])
        
        if 'count' in request_json:
            count = int(request_json['count'])
            
        if 'start_num' in request_json:
            start_num = int(request_json['start_num'])
        
        if 'order' in request_json:
            order = str(request_json['order'])

        if 'emotions' in request_json:
            emotions = str(request_json['emotions'])
            emotion_list = ast.literal_eval(emotions)
        
    return str(get_recommendation(user_id = uid, start_num = start_num, count = count, order = order, emotion=emotion_list))
